function longestSubstringWithoutRepeatingCharacters(s) {
    let map = {};
    let start = 0;
    let maxLength = 0;

    for (let end = 0; end < s.length; end++) {
        const char = s[end];
        if (map[char]!== undefined && map[char] >= start) {
            start = map[char] + 1;
        }
        map[char] = end;
        maxLength = Math.max(maxLength, end - start + 1);
    }

    return maxLength;
}

